MOD_mktop_superscalar & mktop_superscalar_backing(tSimStateHdl simHdl)
{
  static MOD_mktop_superscalar *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mktop_superscalar(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mktop_superscalar::dump_VCD_defs()
{
  (mktop_superscalar_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mktop_superscalar::dump_VCD(tVCDDumpType dt)
{
  (mktop_superscalar_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mktop_superscalar_backing(sim_hdl));
}
